import React from 'react';
import { Main } from './contents';
import { MainName } from './contents';
import { MainText } from './contents';
import { SiTwitter } from "react-icons/si";

function SocialMain() {
  return (
    <Main>
      <MainName className="English"><SiTwitter />Twitter</MainName>
      <MainText><a href="https://mobile.twitter.com/yoyo_unofficial" target="_blank" rel="noopener noreferrer">https://mobile.twitter.com/yoyo_unofficial</a></MainText>
    </Main>
  );
}

export default SocialMain;
